import Layout from '../common/Layout';
import Popup from '../common/Popup';
import axios from 'axios';
import { useEffect, useState } from 'react';

function Youtube() {
	const [Vids, setVids] = useState([]);
	const [Open, setOpen] = useState(false);
	const [Index, setIndex] = useState(0);

	useEffect(() => {
		const key = 'AIzaSyAQ_q12A-8fN0wGsk6h9ZQJ_GL2AssIeis';
		const playlist = 'PL5EyAeUspyQJ6thaGeeEDM-onb8h9GybD';
		const num = 8;
		const url = `https://www.googleapis.com/youtube/v3/playlistItem?part=snippet&key=&{key}&playlistId=&{playlist}&maxResults=&{num}`;
	});
}

export default Youtube;
